	// Метод для шифрования сообщения по словарю
	encrypt(message) {
		let words = message.split(" ");
		let encryptedWords = [];
		
		for (let word of words) {
			if (word in this.dictionary) {
				encryptedWords.push(this.dictionary[word]);
			} else {
				encryptedWords.push(word);
			}
		}
		
		let encryptedMessage = encryptedWords.join(" ");
		return encryptedMessage;
	}

	// Метод для расшифровки сообщения по словарю
	decrypt(encryptedMessage) {
		const dictionary = this.getInvertedDictionaryValues();
		let encryptedWords = encryptedMessage.split(" ");
		let decryptedWords = [];
		for (let encryptedWord of encryptedWords) {
			if (encryptedWord in dictionary) {
				decryptedWords.push(dictionary[encryptedWord]);
			} else {
				decryptedWords.push(encryptedWord);
			}
		}

		let decryptedMessage = decryptedWords.join(" ");
		return decryptedMessage;
	}

	getInvertedDictionaryValues() {
		const values = {}
		for(let i in this.dictionary) {
			values[ this.dictionary[i] ] = i;
		}

		return values;
	}

	makeDictionary() {
		this.dictionary = {};
		const words = [... new Set( this.rawDictionary.split(" ") )];
		const wordsForKeys = [... new Set( this.rawDictionary.split(" ") )];

		let word;
		while(words.length) {
			word = words.pop();
			const i = this.app.randomInteger(0, wordsForKeys.length - 1);
			this.dictionary[ wordsForKeys[i] ] = word;
			wordsForKeys.splice(i, 1);
		}

		console.log(this.dictionary);
	}
